import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <h1 className="heading_text">Video Games Genres Guide</h1>
      <br />
      <h2 className="describe_text">Welcome to my Video Games Genres Guide. It's a great
          place to learn something new about known genres, and discover new ones.
          Have fun!
      </h2>
    </div>
  );
}

export default App;
